import React from "react";

const Image = (props) => {
  return (
    <React.Fragment>
      <div
        className="m-2 bg-gray-300 md:block mx-auto md:mx-2"
        style={{ cursor: "pointer", width: "80vw", height: "53vw" }}
      >
        <img
          src={`img/projectPictures/${props.projectData.imgPath}3.png`}
          className="h-full float-right"
        />
        <p className="text-center text-5xl p-8">{props.projectData.name}</p>
      </div>
    </React.Fragment>
  );
};

export default Image;
